import './HomeDisplay.css';
import Home from './components/Home';
import Navbar from './components/Navbar';

function HomeDisplay() {
  return (
    <div className="HomeDisplay">
      <Navbar />
      <Home />
    </div>
  );
}

export default HomeDisplay;
